import React from "react";
import { Element } from "react-scroll";
import styled from "styled-components";
import { SectionTitle } from "../../components/sectionTitle";
import AboutImgUrl from "../../assets/pictures/MoreImages/background_shoe.svg";
import {

    createMuiTheme,
    responsiveFontSizes,
    MuiThemeProvider,
    Typography
} from "@material-ui/core";

let theme = createMuiTheme();
theme = responsiveFontSizes(theme);

const MoreAboutContainer = styled(Element)`
    min-height: 500px;
    display: flex;
    flex-direction: column;
    align-items: center;
    font-family: 'Arimo', sans-serif;
    margin-top: 200px;
    text-align: center;
`;

const AboutImg = styled.img`
    width: 300px;
    height: 200px;
`;

const heading = "About Sneak Peek";
const text = "Sneak Peek is an online destination to discover upcming Men's & Womens's Sneakers from the best fashion brands, stores, and boutiques around the world. At Sneak Peek we offer the most unique way of viewing and saving dates for your favorite sneaker releases!";

export function MoreAboutSneakPeek(props) {
    return <MoreAboutContainer>
            <MuiThemeProvider theme={theme}>
                <Typography style={{ fontWeight: "bold", fontFamily: 'Arimo' }} variant="h2" gutterBottom>
                    {heading}
                </Typography>
                <Typography style={{ fontFamily: 'Arimo' }} variant="h6" gutterBottom>
                    {text}
                </Typography>
            </MuiThemeProvider>
    </MoreAboutContainer>
}
